import React, { Component } from "react";
import {
  AiFillFacebook,
  AiFillInstagram,
  AiFillLinkedin,
  AiFillTwitterSquare,
} from "react-icons/ai";

class Footer extends Component {
  state = {};
  render() {
    return (
      <div>
        <div className="social-container">
          <AiFillFacebook
            size={30}
            style={{
              color: "#4968ad",
            }}
          />
          <AiFillInstagram
            size={30}
            style={{
              color: "black",
            }}
          />
          <AiFillTwitterSquare
            size={30}
            style={{
              color: "#49a1eb",
            }}
          />
          <AiFillLinkedin
            size={30}
            style={{
              color: "blue",
            }}
          />
        </div>
      </div>
    );
  }
}

export default Footer;
